const styles = {
    container: {
        flex: 1,
        backgroundColor: '#F0F0F5',
        Top: 10,
        paddingVertical: 25
    },

    view: {
        marginTop: StatusBar.currentHeight,
    },

    cabecalho: {
        flexDirection: "row",
        justifyContent: "space-between",
        padding: 10
    },

    input: {
        flex: 1,
        backgroundColor: "white",
        borderRadius: 25,
        fontSize: 20,
        paddingHorizontal: 20,
    },
}

export default styles;
